      <Card.Img variant="right" src="C:\WebDev\onlineStore2\public\Img1.jpg" width='50%' />
      <Card.Body>
        <Card.Title>Card Title</Card.Title> 
      </Card.Body>
      <Card.Img variant="left" src="C:\WebDev\onlineStore2\public\Img1.jpg" width='50%' />
